import { Box, Heading } from "@chakra-ui/react";
import Pic from "../pic/pic.component";

export default function Pics(props) {
  const { title } = props;

  const items = ["1", "2"];

  return (
    <Box p={2}>
      <Heading pb={3}>{title}</Heading>
      {items.forEach((item) => {
        <Pic numero={item} />;
      })}
    </Box>
  );
}
